import React, { Component } from "react";
import axios from "axios";

class BookingStructure extends Component {
    constructor(props) {
        super(props);

        axios
            .get('http://localhost:1337/salons/')
            .then((res) => {
                this.setState({ salons: res.data });
                console.log(res);
                console.log(res.data);
                this.setState({ moviedates: this.props.moviedates });
            })

        this.state = {
            salons: undefined,
            moviedates: undefined,
        }
    }

    componentDidMount() {
        console.log(this.props)
        axios
            .get('http://localhost:1337/salons/')
            .then((res) => {
                this.setState({ salons: res.data });
                console.log(res);
                console.log(res.data);
                this.setState({ moviedates: this.props.moviedates });
            })
    }

    render() {
        return (

            <div className={"card"} style={{ width: "18rem" }}>
                <div className={"card-wrapper"}>
                    <table>
                        <thead>
                            <tr>
                                <th>
                                    &nbsp;
                            </th>
                                {this.salons.map((salon) => {
                                    <th>
                                        {salon.salon}
                                    </th>
                                })}
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>

                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div >

        )
    }
}

export default BookingStructure;
